;; **
;;; Extract a foreclojure.utils sub-graph consisting of the local neighborhood of these functions: What incoming and outgoing vertices are there? Are there useful communities that we can pull out of these?
;;; 
;;; * For each id, filter to all edges that contain these ids in in or out.
;;; * Once we have the edges, convert these to labels.
;;; * Create a new graph based on these edge labels.
;;;   
;; **

;; @@
(def util-edge-ids (filter #(some util-ids (vals (select-keys % [:out-v :in-v]))) (vals (:edge-data g))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;foreclojure/util-edge-ids</span>","value":"#'foreclojure/util-edge-ids"}
;; <=

;; @@
(def util-edges 
  (map (fn [v-ids] (flatten (props (traversal g v-ids []) :label)))
    (map #(vals (select-keys % [:out-v :in-v])) util-edge-ids)))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;foreclojure/util-edges</span>","value":"#'foreclojure/util-edges"}
;; <=

;; **
;;; Keep only the internal edges in foreclojure:
;; **

;; @@
(def foreclojure-util-only-edges (filter (fn [[out-v in-v]] (and (.contains in-v "foreclojure") (.contains out-v "foreclojure"))) util-edges))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;foreclojure/foreclojure-util-only-edges</span>","value":"#'foreclojure/foreclojure-util-only-edges"}
;; <=

;; @@
(def util-graph (reduce (fn [g [out-v in-v]] (add-edge g out-v in-v)) (empty-graph) foreclojure-util-only-edges))
