;; **
;;; We can now look at a clustered hierarchical visualization in yEd to see features of the call graph that stand out. Use "Grouping-> Layout Groups" and "Edges->Routing Style->Poliline"
;;; 
;;; * Isolated clusters are immediate candidates for factoring out into their own namespace.
;;; * Functions with in-degree 1 and out-degree 0 can be immediately inlined into their client namespace.
;;; * Consider moving vertices with high degree or pagerank centrality to their own namespace.
;; **

;; @@
(def in-degree (degree-centrality util-graph :in))
(def out-degree (degree-centrality util-graph :out))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;foreclojure/out-degree</span>","value":"#'foreclojure/out-degree"}
;; <=

;; **
;;; Get the incoming edges, outgoing vertices of functions with in-degree 1 and out-degree 0.
;;; The result gives us the list of functions and the namespace they should move to:
;; **

;; @@
(pprint (map #(str "Move " % " to " (-> util-graph (v (label-index util-graph %)) in (props :label) flatten first (clojure.string/split #"/") first))
(clojure.set/intersection
  (set (map first (filter (fn [[k v]] (= 1 v)) in-degree)))
  (set (map first (filter (fn [[k v]] (zero? v)) out-degree))))))
